import produce from 'immer';

const  ProfileCalculationsState={
    profileCalculation:{},
    ProfileCalculations:[]   
}


export const  ProfileCalculationsReducer=produce((state,action)=>{
    switch(action.type)
    {
         case "CALCULATION_PROFILE":state.calculation=action.paylod;break;
         case "AVARAGE_POS":state.calculation=action.paylod;break;
         case "AVARAGE_NEG":state.calculation=action.paylod;break;
         case "AVARAGE_UNSUP":state.calculation=action.paylod;break;
         case "PNU":state.calculation=action.paylod;break;
         
         
    }
},ProfileCalculationsState)
